import React, { Component } from 'react'
import {Card} from 'antd'

export default class Home extends Component {

    state = {requestTotal:{gi:1000,do:800}}

    render() {
        return (
            <Card title='Proxy Forms Request Total' style={{ width: 300, fontWeight: "bolder" }}>
                <p>Global-Int: {this.state.requestTotal.gi}</p>
                <p>Domestic: {this.state.requestTotal.do}</p>
            </Card>
        )
    }
}
